  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Tewaukon WMD
  outlines Refuge accomplishments during the 1976 calendar year. The report begins
  with an introduction to the Refuge and information about weather conditions, habitat
  conditions, land acquisition activities, and the system status. Construction, maintenance,
  and wildfires are also described. Habitat management is covered; croplands, grasslands,
  and easements for waterfowl management are discussed. The wildlife section of the
  report discusses migratory birds and mammals. Interpretation and recreation activities
  are outlined; topics include law enforcement. Items of interest are attached.\",\n\t\"owner_org\":
